Pensacola EggFest will take place at Noon, Sunday November 16th, 2025, at Hadji Temple 800 W 9 Mile Rd, Pensacola, FL 32534 .  The event hosts BBQ teams and backyard cooks from all over the United States who share two things: a love of cooking and the joy of giving back to their communities.  Since 2013, over $940,000, has been donated to local charities from this little BBQ party.
Come join us to taste all the good food.
(Click here for Tickets!)
Better yet, grab some friends and join us as a cook team.
(Click here to learn more and register your team.)
